// src/components/HomePage.js
import React from 'react';
import { Container, Typography, Box } from '@mui/material';
import '../styles/HomePage.css';
import spaImage from '../images/spa.jpg';
import maniPediImage from '../images/manicure.jpg';
import waxingImage from '../images/waxing.jpg';
import flowerImage from '../images/flower.jpg';
import instagramIcon from '../images/instagram.png'; // Instagram icon
import googleIcon from '../images/google.png'; // Google review icon


// const items = [
//   {
//     name: "Spa",
//     description: "Relax and rejuvenate with our spa treatments.",
//     image: spaImage
//   },
//   {
//     name: "Mani/Pedi",
//     description: "Perfect nails with our mani/pedi services.",
//     image: maniPediImage
//   },
//   {
//     name: "Waxing",
//     description: "Smooth and silky skin with our waxing services.",
//     image: waxingImage
//   }
// ];
const HomePage = () => {
    return (
      <div className="container">
        <section className="hero-section">
          <p className="hero-text">Nothing improves your mood like a new manicure.</p>
        </section>
        <section className="grid-section">
          <div className="grid-item">
            <img src={spaImage} alt="Spa" />
            <p>Spa</p>
          </div>
          <div className="grid-item">
            <img src={maniPediImage} alt="Mani/Pedi" />
            <p>Mani/Pedi</p>
          </div>
          <div className="grid-item">
            <img src={waxingImage} alt="Waxing" />
            <p>Waxing</p>
          </div>
        </section>
        <div className="flower-image-container">
        <img src={flowerImage} alt="Full Width" className="flower-image" />
        <div className="overlay-text">
          <p>Follow us on Instagram & 
          <p>Leave us a review!</p></p>
          <div className="overlay-links">
            <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
              <img src={instagramIcon} alt="Instagram" />
            </a>
            <a href="https://www.google.com/maps" target="_blank" rel="noopener noreferrer">
              <img src={googleIcon} alt="Google Review" />
            </a>
        </div>
            {/* Follow Button */}
            <div className="follow-button-container">
            <button className="follow-button">Follow</button>
          </div>
        </div>
      </div>
    </div>
  );
};

  export default HomePage;
